import React from "react";
import { Button } from "antd";
import { createGlobalStyle } from "styled-components";

const GlobalButton = createGlobalStyle`
.ant-btn-primary{
  background:#5E6BE5;
  border-color:#5E6BE5;
}
.ant-btn-primary:hover{
  background:#5E6BE5;
  border-color:#5E6BE5;
}

`;

const DoneFail = () => {
  return (
    <div>
      <GlobalButton />
      <Button type="primary">&nbsp;</Button>
    </div>
  );
};

export default DoneFail;
